def merge_the_tools(string, k):
    subLength = int(len(string)/k)
    subStrings = [string[x*k:x*k+k] for x in range(subLength)]
    print("\n".join([''.join(sorted(set(x), key=x.index)) for x in subStrings]))


if __name__ == '__main__':
    text = ""
    length = 3333
    merge_the_tools(text, length)